import Pfe from "views/Pfe";
import Notifications from "views/Notifications.js";
import Templates from "views/Templates.js";
import Wevioo from "views/Wevioo.js";
import TableList from "views/TableList.js";
import Labels from "views/Labels.js";
import Upgrade from "views/Upgrade.js";
import UserPage from "views/UserPage.js";

var dashRoutes = [
  {
    path: "/Pfe",
    name: "Pfe",
    icon: "design_app",
    component: <Pfe />,
    layout: "/admin",
  },
  {
    path: "/Templates",
    name: "Templates",
    icon: "design_image",
    component: <Templates />,
    layout: "/admin",
  },
  {
    path: "/Labels",
    name: "Labels",
    icon: "location_map-big",
    component: <Labels />,
    layout: "/admin",
  },
  {
    path: "/notifications",
    name: "Notifications",
    icon: "ui-1_bell-53",
    component: <Notifications />,
    layout: "/admin",
  },
  {
    path: "/extended-tables",
    name: "Table List",
    icon: "files_paper",
    component: <TableList />,
    layout: "/admin",
  },
  {
    path: "/Wevioo",
    name: "Wevioo",
    icon: "design-2_ruler-pencil",
    component: <Wevioo />,
    layout: "/admin",
  },
  {
    path: "/user-page",
    name: "User Profile",
    icon: "users_single-02",
    component: <UserPage />,
    layout: "/admin",
  },  
  {
    pro: true,
    path: "/upgrade",
    name: "Upgrade to PRO",
    icon: "objects_spaceship",
    component: <Upgrade />,
    layout: "/admin",
  },
];
export default dashRoutes;
